import React from "react";
import Box from '@mui/material/Box';
import Typography from "@mui/material/Typography";
import {
  ComposedChart,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  Area,
  Line,
} from "recharts";

//表示させたいデータ群
const dataGraph = [
  { startStr: "2021/11/1", groupId: 7.5, title: '不調' },
  { startStr: "2021/11/2", groupId: 9, title: '普通' },
  { startStr: "2021/11/3", groupId: 8, title: '好調' },
  { startStr: "2021/11/4", groupId: 6.5, title: '不調' },
  { startStr: "2021/11/5", groupId: 7, title: '好調' },
  { startStr: "2021/11/6", groupId: 6, title: '普通' },
];

export const SleepData = ({
  diaries,
}) => {
  return (
    <>
      <Typography variant="h6">
        <Box sx={{
          letterSpacing: 6,
          mt: 3,
          color: '#42a5f5',
        }}>
          睡眠時間と感情の推移
        </Box>
      </Typography>

      <ComposedChart
        width={1000}
        height={280}
        data={diaries}
        margin={{ top: 20, right: 60, bottom: 0, left: 0 }}
      >
        <XAxis
          dataKey="startStr"
        />
        <YAxis
          yAxisId={1}
          domain={[5, 'dataMax + 1']}
          label={{ value: "睡眠時間", angle: -90 }}
          tickCount={6}
          type="number"
        />
        <YAxis
          yAxisId={2}
          orientation="right"
          tickCount={4}
          type="category"
        />
        <Tooltip />
        <Legend />
        <CartesianGrid
          stroke="#f5f5f5"
          vertical={false}
        />
        <Area
          yAxisId={1}
          type="monotone"
          dataKey="groupId"
          stroke="#00aced"
          fillOpacity={1}
          fill="rgba(0, 172, 237, 0.2)"
        />

        <Line
          yAxisId={2}
          type="monotoneX"
          dataKey="title"
          stroke="#2250A2"
        />
      </ComposedChart>
    </>
  )
}
